import { extendTheme } from '@chakra-ui/react';
import { theme } from '@chakra-ui/theme';

const customTheme = extendTheme({
    brand: {
        900: "#1a365d",
        800: "#153e75",
        700: "#2a69ac",
    },
});

export { customTheme };
